<!-- HMI module -->
<div class="flex w-full h-full justify-center items-center font-mono">
<script>

const color = ["#FF0000","#00FF4D","#FFF600"];
const color1 = ["#FF0000","#00FF4D"];       // for valves only (on/off)
let counter = 0;
function changecolor(objectid){
    const objectchange = document.getElementById(objectid);
    if (objectchange){
        objectchange.setAttribute("fill",color1[counter % color1.length]);
        counter ++;
    }
}


function hmiUpdateValue(id, value) {
    if (value != undefined && !Number.isNaN(value)) {
        let elem = document.getElementById(id).firstElementChild;
        if (elem) {
            elem.innerHTML = value.toFixed(1);
            if (id=="HMI_N2O-1TEMP"){
            hmiUpdateTemperature("gauge_1_fill", value,"guage_1_bar");
            } else if(id =="HMI_N2O-2TEMP"){
            hmiUpdateTemperature("gauge_2_fill", value,"guage_2_bar");
            } else if(id =="HMI_O2TEMP"){
            hmiUpdateTemperature("gauge_3_fill", value,"guage_3_bar");
            }
            
        }
    }
}


function hmiUpdateTemperature(id, value,id2) {
    const guage = document.getElementById(id);
    const guagesize = document.getElementById(id2);
    
    if (guage) {
        if (value >= 15 && value<=25) {
            guage.setAttribute("fill", color[2]);
        } else if (value > 25) {
            guage.setAttribute("fill", color[0]);
        } else if(value < 15){
            guage.setAttribute("fill", color[1]);
        }
        
        if (value >= 0 && value <= 36) {
            let height = 69 - ((value / 36) * 69);
            guagesize.setAttribute("height", height);
        }
        else if (value < 0) {
            guagesize.setAttribute("height", 69);
        }
        else if (value > 36) {
            guagesize.setAttribute("height", 0);
        }
        
    }
}

function solenoidupdate(solenoidbool, id){
    const solenoid1 =document.getElementById(id);
    if(id == 'solenoidsV7'){
        if (solenoidbool == true){
        solenoid1.setAttribute("fill","#FF0000");
    }   else if(solenoidbool == false){
        solenoid1.setAttribute("fill","#00FF4D");
    }    
    }else{
        if (solenoidbool == true){
        solenoid1.setAttribute("fill","#00FF4D");
    } else if(solenoidbool == false){
        solenoid1.setAttribute("fill","#FF0000");
    }
    }
}
